import re;print(sum([(not bool(sum([([match.start() for match in re.compile(pages[0]).finditer(line)] > [match.start() for match in re.compile(pages[1]).finditer(line)] and (len(re.compile(pages[0]).findall(line)) > 0) and (len(re.compile(pages[1]).findall(line)) > 0)) for pages in re.compile(r'(\d{2})\|(\d{2})').findall(open('./input/day5-1.txt').read())])))*int(line[int(len(line)/2-1):int(len(line)/2+1)]) for line in re.compile(r'((?:\d{2},*){2,100})').findall(open('./input/day5-1.txt').read())]))